pragma solidity 0.6.12;

contract ICO {
    address public owner;
    address public newowner;
    uint256 public supply;
    uint256 public tokenprice;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public payable {
        require(msg.value == 0, "Ether value must be zero for constructor");
        supply = 0x409f9cbc7c4a04c220000000;
        tokenprice = 0xba43b7400;
        owner = msg.sender;
    }

    function acceptOwnership(address _newowner) public {
        require(msg.sender == owner, "Only owner can transfer ownership");
        newowner = _newowner;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner, "Only owner can transfer ownership");
        newowner = _newowner;
    }

    function endICO() public {
        require(msg.sender == owner && address(this).balance <= balanceof[msg.sender], "Cannot end ICO");
        balanceof[msg.sender] -= address(this).balance;
        msg.sender.transfer(address(this).balance);
    }

    fallback() external payable {
        require(msg.value >= tokenprice, "Not enough Ether sent");
        if (msg.value < 0x1bc16d674ec80000) {
            if (msg.value >= 0xde0b6b3a7640000) {
                uint256 value = ((((0xde0b6b3a7640000*msg.value)/tokenprice)*25)+(100*((0xde0b6b3a7640000*msg.value)/tokenprice)))/100;
                require(value <= balanceof[address(this)], "Not enough balance in the contract");
                balanceof[address(this)] -= value;
                if (value + balanceof[msg.sender] >= balanceof[msg.sender]) {
                    balanceof[msg.sender] += value;
                }
            }
        }
    }

    function burn(uint256 _value) public {
        require(_value <= balanceof[msg.sender], "Not enough balance to burn");
        balanceof[msg.sender] -= _value;
        if (_value <= supply) {
            supply -= _value;
        }
    }

    function BuyTokens() public payable {
        require(msg.value >= tokenprice, "Not enough Ether sent");
        if (msg.value < 0x1bc16d674ec80000) {
            if (msg.value >= 0xde0b6b3a7640000) {
                uint256 value = ((((0xde0b6b3a7640000*msg.value)/tokenprice)*25)+(100*((0xde0b6b3a7640000*msg.value)/tokenprice)))/100;
                require(value <= balanceof[address(this)], "Not enough balance in the contract");
                balanceof[address(this)] -= value;
                if (value + balanceof[msg.sender] >= balanceof[msg.sender]) {
                    balanceof[msg.sender] += value;
                }
            }
        }
    }

    function transfer(address _to, uint256 _value) public {
        require(_value <= balanceof[msg.sender], "Not enough balance to transfer");
        require(_to != address(0), "Cannot transfer to zero address");
        balanceof[msg.sender] -= _value;
        if (_value + balanceof[_to] >= balanceof[_to]) {
            balanceof[_to] += _value;
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= balanceof[_from] && _value <= allowance[_from][msg.sender], "Not enough balance or allowance to transfer");
        balanceof[_from] -= _value;
        if (_value + balanceof[_to] >= balanceof[_to]) {
            balanceof[_to] += _value;
            allowance[_from][msg.sender] -= _value;
        }
    }
}
